definitions.description:
A thin wrapper around u128 that is using strings for JSON encoding/decoding,
such that the full u128 range can be used for clients that convert JSON numbers to floats,
like JavaScript and jq.

# Examples

Use `from` to create instances of this and `u128` to get the value out:

```
# use cosmwasm_std::Uint128;
let a = Uint128::from(123u128);
assert_eq!(a.u128(), 123);

let b = Uint128::from(42u64);
assert_eq!(b.u128(), 42);

let c = Uint128::from(70u32);
assert_eq!(c.u128(), 70);
```

A point in time in nanosecond precision.

This type can represent times from 1970-01-01T00:00:00Z to 2554-07-21T23:34:33Z.

## Examples

```
# use cosmwasm_std::Timestamp;
let ts = Timestamp::from_nanos(1_000_000_202);
assert_eq!(ts.nanos(), 1_000_000_202);
assert_eq!(ts.seconds(), 1);
assert_eq!(ts.subsec_nanos(), 202);

let ts = ts.plus_seconds(2);
assert_eq!(ts.nanos(), 3_000_000_202);
assert_eq!(ts.seconds(), 3);
assert_eq!(ts.subsec_nanos(), 202);
```

pay_packet_fee.description:
Incentivizes the next IBC packet sent after this message with a fee.
Note that this does not necessarily have to be a packet sent by this contract.
The fees are taken from the contract's balance immediately and locked until the packet is handled.

# Example

Most commonly, you will attach this message to a response right before sending a packet using
[`IbcMsg::SendPacket`] or [`IbcMsg::Transfer`].

```rust
# use cosmwasm_std::{IbcMsg, IbcEndpoint, IbcFee, IbcTimeout, Coin, coins, CosmosMsg, Response, Timestamp};

let incentivize = IbcMsg::PayPacketFee {
port_id: "transfer".to_string(),
channel_id: "source-channel".to_string(),
fee: IbcFee {
receive_fee: coins(100, "token"),
ack_fee: coins(201, "token"),
timeout_fee: coins(200, "token"),
},
relayers: vec![],
};
let transfer = IbcMsg::Transfer {
channel_id: "source-channel".to_string(),
to_address: "receiver".to_string(),
amount: Coin::new(100u32, "token"),
timeout: IbcTimeout::with_timestamp(Timestamp::from_nanos(0)),
memo: None,
};

# #[cfg(feature = "stargate")]
let _: Response = Response::new()
.add_message(CosmosMsg::Ibc(incentivize))
.add_message(CosmosMsg::Ibc(transfer));
```

definitions.description:
This message type allows the contract interact with the [x/gov] module in order
to cast votes.

[x/gov]: https://github.com/cosmos/cosmos-sdk/tree/v0.45.12/x/gov

## Examples

Cast a simple vote:

```
# use cosmwasm_std::{
#     HexBinary,
#     Storage, Api, Querier, DepsMut, Deps, entry_point, Env, StdError, MessageInfo,
#     Response, QueryResponse,
# };
# type ExecuteMsg = ();
use cosmwasm_std::{GovMsg, VoteOption};

#[entry_point]
pub fn execute(
deps: DepsMut,
env: Env,
info: MessageInfo,
msg: ExecuteMsg,
) -> Result<Response, StdError> {
// ...
Ok(Response::new().add_message(GovMsg::Vote {
proposal_id: 4,
option: VoteOption::Yes,
}))
}
```

Cast a weighted vote:

```
# use cosmwasm_std::{
#     HexBinary,
#     Storage, Api, Querier, DepsMut, Deps, entry_point, Env, StdError, MessageInfo,
#     Response, QueryResponse,
# };
# type ExecuteMsg = ();
# #[cfg(feature = "cosmwasm_1_2")]
use cosmwasm_std::{Decimal, GovMsg, VoteOption, WeightedVoteOption};

# #[cfg(feature = "cosmwasm_1_2")]
#[entry_point]
pub fn execute(
deps: DepsMut,
env: Env,
info: MessageInfo,
msg: ExecuteMsg,
) -> Result<Response, StdError> {
// ...
Ok(Response::new().add_message(GovMsg::VoteWeighted {
proposal_id: 4,
options: vec![
WeightedVoteOption {
option: VoteOption::Yes,
weight: Decimal::percent(65),
},
WeightedVoteOption {
option: VoteOption::Abstain,
weight: Decimal::percent(35),
},
],
}))
}
```

This is the result type that is returned from a sub message execution.

We use a custom type here instead of Rust's Result because we want to be able to
define the serialization, which is a public interface. Every language that compiles
to Wasm and runs in the ComsWasm VM needs to create the same JSON representation.

Until version 1.0.0-beta5, `ContractResult<SubMsgResponse>` was used instead
of this type. Once serialized, the two types are the same. However, in the Rust type
system we want different types for clarity and documentation reasons.

# Examples

Success:

```
# use cosmwasm_std::{to_json_string, Binary, Event, SubMsgResponse, SubMsgResult};
#[allow(deprecated)]
let response = SubMsgResponse {
data: Some(Binary::from_base64("MTIzCg==").unwrap()),
events: vec![Event::new("wasm").add_attribute("foo", "bar")],
msg_responses: vec![],
};
let result: SubMsgResult = SubMsgResult::Ok(response);
assert_eq!(
to_json_string(&result).unwrap(),
r#"{"ok":{"events":[{"type":"wasm","attributes":[{"key":"foo","value":"bar"}]}],"data":"MTIzCg==","msg_responses":[]}}"#,
);
```

Failure:

```
# use cosmwasm_std::{to_json_string, SubMsgResult, Response};
let error_msg = String::from("Something went wrong");
let result = SubMsgResult::Err(error_msg);
assert_eq!(to_json_string(&result).unwrap(), r#"{"error":"Something went wrong"}"#);
```
